import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';

import HomePage from './pages/HomePage';
import ServicePage from './pages/ServicePage';
import DoctorProfilePage from './pages/DoctorProfilePage';
import LoginPage from './pages/LoginPage';
import SignUpPage from './pages/SignUpPage';
import AdminDashboard from './pages/AdminDashboard';
import DoctorDashboard from './pages/DoctorDashboard';
import PatientDashboard from './pages/PatientDashboard';
import PatientProfileForDoctorPage from './pages/PatientProfileForDoctorPage';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import ForgotPasswordRequestPage from './pages/ForgotPasswordRequestPage';
import ResetPasswordPage from './pages/ResetPasswordPage';
import ContactUsPage from './pages/ContactUsPage';
import HelpPage from './pages/HelpPage';
import BlogsPage from './pages/BlogsPage';

// Komponenta za zaštićene rute (Protected Route)
const ProtectedRoute = ({ children, requiredRoles }) => {
  const { isAuthenticated, hasRole, loading, user } = useAuth(); // Dohvati i 'user' objekt za dodatno logiranje

  console.log("ProtectedRoute: Current Auth State - isAuthenticated:", isAuthenticated, "loading:", loading, "user:", user, "requiredRoles:", requiredRoles);

  if (loading) {
    // Prikazati loading spinner ili prazan ekran dok se autentifikacija ne provjeri
    console.log("ProtectedRoute: Authentication still loading...");
    return (
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', fontSize: '24px' }}>
        Loading authentication...
      </div>
    );
  }

  if (!isAuthenticated) {
    console.log("ProtectedRoute: User not authenticated. Redirecting to login.");
    return <Navigate to="/login" replace />;
  }

  // Provjeri ima li korisnik potrebnu ulogu
  const userHasRequiredRole = requiredRoles.some(role => hasRole(role));
  console.log("ProtectedRoute: User has required role?", userHasRequiredRole, "User Roles:", user?.userRoles); // Dodan user?.userRoles za bolji pregled

  if (userHasRequiredRole) {
    console.log("ProtectedRoute: User is authorized. Rendering children.");
    return children;
  } else {
    console.warn("ProtectedRoute: User not authorized for this route. Required roles:", requiredRoles, "User roles:", user?.userRoles);
    // Ako korisnik nije autoriziran, možete ga preusmjeriti na neku "Access Denied" stranicu ili početnu
    return <Navigate to="/" replace />; // Preusmjeri na početnu stranicu ili prikaži poruku o neautoriziranom pristupu
  }
};


function App() {
  return (
    <Router>
      <AuthProvider>
        <div className="App">
          {/* Ovdje možete dodati globalnu navigaciju ili header ako je potrebno */}
          <Routes>
            {/* Javne rute */}
            <Route path="/" element={<HomePage />} />
            <Route path="/services" element={<ServicePage />} />
            <Route path="/doctors/:id" element={<DoctorProfilePage />} />
            <Route path="/login" element={<LoginPage />} />
            <Route path="/sign-up" element={<SignUpPage />} />
            <Route path="/forgot-password" element={<ForgotPasswordRequestPage />} />
            <Route path="/reset-password" element={<ResetPasswordPage />} />

            {/* Zaštićene rute za dashboarde */}
            <Route
              path="/admin-dashboard"
              element={
                <ProtectedRoute requiredRoles={['ROLE_ADMIN']}>
                  <AdminDashboard />
                </ProtectedRoute>
              }
            />
            <Route
              path="/doctor-dashboard"
              element={
                <ProtectedRoute requiredRoles={['ROLE_DOKTOR']}> {/* <-- KLJUČNO: PROVJERI OVU ROLU! */}
                  <DoctorDashboard />
                </ProtectedRoute>
              }
            />
            <Route
              path="/patient-dashboard"
              element={
                <ProtectedRoute requiredRoles={['ROLE_PACIJENT']}>
                  <PatientDashboard />
                </ProtectedRoute>
              }
            />
            {/* Zaštićena ruta za pacijentov profil (za doktore) */}
            <Route
              path="/doctor/patient-profile/:patientId"
              element={
                <ProtectedRoute requiredRoles={['ROLE_DOCTOR']}>
                  <PatientProfileForDoctorPage />
                </ProtectedRoute>
              }
            />

            {/* Ostale javne rute */}
            <Route path="/contact-us" element={<ContactUsPage />} />
            <Route path="/help" element={<HelpPage />} />
            <Route path="/blogs" element={<BlogsPage />} />

            {/* Ruta za nepoznate stranice */}
            <Route path="*" element={
                <div className="d-flex flex-column justify-content-center align-items-center" style={{ minHeight: '100vh' }}>
                    <h2>404 - Page Not Found</h2>
                    <p>The page you are looking for does not exist.</p>
                    <Link to="/" className="btn btn-primary mt-3">Go to Home</Link>
                </div>
            } />
          </Routes>
        </div>
      </AuthProvider>
    </Router>
  );
}

export default App;
